import React from "react";

function Navigation() {
  return (
    <header>
      <strong>Giuseppe</strong>

      <nav>
        <ul>
          <li><a href="#home"><em><b>Home</b></em></a></li>
          <li><a href="#about"><em><b>About</b></em></a></li>
          <li><a href="#portfolio"><em><b>Projects</b></em></a></li>
          <li><a href="#contact"><em><b>Contact</b></em></a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Navigation;
